-- Database
CREATE TABLE departments (
    id      SERIAL          PRIMARY KEY,
    name    VARCHAR(50)     NOT NULL
);

CREATE TABLE employee_addresses (
    id          BIGSERIAL       PRIMARY KEY,
    street_1    VARCHAR(250)    NOT NULL,
    street_2    VARCHAR(250),
    city        VARCHAR(250)    NOT NULL,
    state       CHAR(2)         NOT NULL,
    zip_code    VARCHAR(20)     NOT NULL
);

CREATE TABLE employees (
    id          BIGSERIAL       PRIMARY KEY,
    last_name   VARCHAR(250)    NOT NULL,
    first_name  VARCHAR(250)    NOT NULL,
    hire_date   DATE            NOT NULL,
    department  INTEGER         REFERENCES departments(id) NOT NULL,
    home_phone  BIGINT          NOT NULL,
    home_email  VARCHAR(250),
    work_email  VARCHAR(250)    NOT NULL,
    home_addr   BIGINT          REFERENCES employee_addresses(id) NOT NULL ON DELETE CASCADE,
    work_addr   BIGINT          REFERENCES employee_addresses(id) NOT NULL,
    salary      NUMERIC         NOT NULL
);
CREATE INDEX employees_last_name_idx ON employees(last_name);
CREATE INDEX employees_department_idx ON employees(department);

